import React from "react";
import LiveStats from "./LiveStats";

const Home = () => {
  return (
    <div className="container row mt-3">
      <div className="col-lg-3">
        <LiveStats />
      </div>
      <div className="col-lg-3">
        <LiveStats />
      </div>
      <div className="col-lg-3">
        <LiveStats />
      </div>
      <div className="col-lg-3">
        <LiveStats />
      </div>
    </div>
  );
};

export default Home;
